ht.columns.drawCell:
__ht__function(g, text, rect, option) {
            var font = option.font,
                color = '#fff',
                x = rect.x,
                y = rect.y,
                height = rect.height,
                width = rect.width,
                texts = text.split('-'),
                ts2 = ht.Default.getTextSize(font, '00'),
                w1 = width/2,
                w2 =  width/2 + ts2.width,
                x2 = x + w1;
                 ht.Default.drawText(g, texts[0], font, color, x , y, w1, height, 'right', 'middle');
                 if (texts.length > 1) {
                     ht.Default.drawText(g, texts[1], font, '#8BB9EA', x2 , y, w2, height, 'left', 'middle');
                 }
        }

